import React from "react";
import { Button } from "react-bootstrap";
const AppHeader = () => {
	return (
		<header className="d-flex justify-content-between py-3 border-bottom mb-5">
			<h4>List of Users</h4>
			<button className="btn">Logout</button>
		</header>
	);
};

export default AppHeader;
